import React from 'react';
import { makeStyles, Divider } from '@material-ui/core';
import { Section, SectionAlternate } from 'components/organisms';
import { GetStarted, Features, Reviews, QuickStart, Services, Hero } from './components';
import { CardProduct } from 'components/organisms';
import { SwiperImage } from 'components/molecules';
import { Box, Grid, Typography } from '@material-ui/core';

const item = {
  images: [{
      src: 'https://assets.maccarianagency.com/the-front/photos/coworking/place3.jpg',
      alt: '', 
  }, {
      src: 'https://assets.maccarianagency.com/the-front/photos/coworking/place1.jpg',
      alt: '', 
  }, {
      src: 'https://assets.maccarianagency.com/the-front/photos/coworking/place2.jpg',
      alt: '', 
  }],
  title: 'Tenoha Space',
  address: 'Via E. Gola 4, 20147 Milan, Italy',
  price: '$980 / month',
};


const useStyles = makeStyles(() => ({
  sectionAlternateNoPaddingTop: {
    '& .section-alternate__content': {
      paddingBottom: 0,
    },
  },
  dividerSection: {
    paddingTop: 0,
    paddingBottom: 0,
  },
}));

const IndexView = ({ themeMode }) => {
  const classes = useStyles();

  return (
    <div>
      <Hero themeMode={themeMode} />
      <Services />
      <div>

      <CardProduct
        style={{ maxWidth: 500 }}
        mediaContent={(
          <>
            <SwiperImage
              items={item.images}
            />
            <div style={{ position: 'absolute', left: 8, bottom: 16, zIndex: 9, background: 'white', padding: '4px 8px', borderRadius: '8px' }}>
              <Typography variant="body1" color="primary">
                {item.price}
              </Typography>
            </div>
          </>
        )}
        cardContent={(
          <Grid container spacing={1}>
            <Grid item xs={12}>
              <Typography variant="h6" color="textPrimary" align="left">
                {item.title}
              </Typography>
            </Grid>
            <Grid item xs={12}>
              <Typography variant="body1" color="textSecondary" align="left">{item.address}</Typography>
            </Grid>
          </Grid>
        )}
      />

      </div>
      <SectionAlternate className={classes.sectionAlternateNoPaddingTop}>
        <QuickStart />
      </SectionAlternate>
      <SectionAlternate>
        <Features />
      </SectionAlternate>
      <Section>
        <Reviews />
      </Section>
      <Section className={classes.dividerSection}>
        <Divider />
      </Section>
      <Section narrow>
        <GetStarted />
      </Section>
    </div>
  );
};

export default IndexView;
